import React from "react";

class Lifecycles extends React.Component{
    constructor(){
        super();
        console.log('Constructor');
    }

    componentDidMount(){
        console.log('componenctDidMount');
    }

    componentDidUpdate(){
        console.log('ConponentDidUpdate');
    }
}
export default Lifecycles;
